import React from "react";
import ReactDOM from "react-dom";
import { Router } from "react-router";
import App from "./App";
import { createBrowserHistory } from "history";

const history = createBrowserHistory();
ReactDOM.render(
  <Router>
    <App />
  </Router>,
  document.getElementById("root")
);

